    <div>
      <section className="heading">
        <h1 className="heading">CUT THE BS</h1>
        <NavBar className="heading" />
      </section>
      <section className="articleLists">
        <ArticleList className="artricleList" category="usa" />
        <ArticleList className="artricleList" category="world" />
        <ArticleList className="artricleList" category="politics" />
        <ArticleList className="artricleList" category="business" />
        <ArticleList className="artricleList" category="health" />
        <ArticleList className="artricleList" category="entertainment" />
        <ArticleList className="artricleList" category="opinion" />
      </section>
    </div>
  );
}

export default App;
